// export default ProfilePage;
// Import React and useState
import React, { useState } from 'react';
import '../styles/pages/ProfileStyle.css';
import Navbar from '../components/Navbar';

function ProfilePage() {
    const [isEditing, setIsEditing] = useState(true); // Start in edit mode
    const [userData, setUserData] = useState({
        email: 'b.alramlawi360@gmail.com',
        username: 'ggg',
        userType: 'Regular',
        hourlyRate: '$900',
        isVerified: 'Yes',
    });

    const handleSaveClick = () => {
        setIsEditing(false);
        // Add logic to save updated data here
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUserData({
            ...userData,
            [name]: value,
        });
    };

    return (
        <div className="profile-container">
            <Navbar />
            <div className="profile-card">
                <div className="profile-header">
                    <img
                        src={process.env.PUBLIC_URL + '/profile.png'}
                        alt="ProfilePage"
                        className="profile-image"
                    />
                    <div className={`status-rectangle ${userData.isVerified === 'Yes' ? 'verified' : 'not-verified'}`}>
                        {userData.isVerified === 'Yes' ? 'Verified' : 'Not Verified'}
                    </div>
                    <h2 className="profile-title">ProfilePage Information</h2>
                </div>
                <div className="profile-info">
                    <div className="profile-item">
                        <label className="profile-label">Email:</label>
                        <input
                            type="text"
                            name="email"
                            value={userData.email}
                            onChange={handleInputChange}
                            className="profile-input"
                        />
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Username:</label>
                        <input
                            type="text"
                            name="username"
                            value={userData.username}
                            onChange={handleInputChange}
                            className="profile-input"
                        />
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">User Type:</label>
                        <input
                            type="text"
                            name="userType"
                            value={userData.userType}
                            onChange={handleInputChange}
                            className="profile-input"
                        />
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Hourly Rate:</label>
                        <input
                            type="text"
                            name="hourlyRate"
                            value={userData.hourlyRate}
                            onChange={handleInputChange}
                            className="profile-input"
                        />
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Verified:</label>
                        <input
                            type="text"
                            name="isVerified"
                            value={userData.isVerified}
                            onChange={handleInputChange}
                            className="profile-input"
                        />
                    </div>
                    <button
                        className="profile-save-button" // Apply the save button style
                        onClick={handleSaveClick}
                    >
                        Save
                    </button>
                </div>
            </div>
        </div>
    );
}

export default ProfilePage;
